import java.util.HashMap;
public class Solution {
    public int largestIsland(int[][] grid) {
        if (grid == null || grid.length == 0) return 0;

        int n = grid.length;
        HashMap<Integer, Integer> map = new HashMap<>();
        int index = 2;
        int maxArea = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int area = dfs(grid, i, j, index);
                    map.put(index++, area);
                    maxArea = Math.max(maxArea, area);
                }
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    int area = 1;
                    HashSet<Integer> set = new HashSet<>();
                    int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
                    for (int[] dir : dirs) {
                        int x = i + dir[0];
                        int y = j + dir[1];
                        if (x >= 0 && x < n && y >= 0 && y < n && grid[x][y] > 1 && !set.contains(grid[x][y])) {
                            area += map.get(grid[x][y]);
                            set.add(grid[x][y]);
                        }
                    }
                    maxArea = Math.max(maxArea, area);
                }
            }
        }

        return maxArea;
    }

    private int dfs(int[][] grid, int i, int j, int index) {
        if (i < 0 || i >= grid.length || j < 0 || j >= grid[0].length || grid[i][j] != 1) return 0;

        grid[i][j] = index;
        return dfs(grid, i - 1, j, index) + dfs(grid, i + 1, j, index) + dfs(grid, i, j - 1, index) + dfs(grid, i, j + 1, index) + 1;
