public class Solution {
    public int[][] flipAndInvertImage(int[][] image) {
        for (int[] row : image) {
            int left = 0;
            int right = row.length - 1;
            while (left < right) {
                // Swap elements at left and right indices
                int temp = row[left];
                row[left] = row[right];
                row[right] = temp;
                left++;
                right--;
            }
        }

        for (int[] row : image) {
            for (int i = 0; i < row.length; i++) {
                // Invert the element
                row[i] ^= 1;
            }
        }

        return image;
    }
}

