    public String maskPII(String s) {
        StringBuilder sb = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isDigit(c)) {
                sb.append(c);
            }
        }

        if (sb.length() == 13) {
            return "+***-***-***-" + sb.substring(9, 13);
        } else if (sb.length() > 10) {
            int len = sb.length();
            String country = "+" + new String(new char[len - 10]).replace('\0', '*');
            return country + "-***-***-" + sb.substring(len - 4, len);
        }

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '@') {
                int idx1 = s.indexOf('@');
                String name = s.substring(0, idx1).toLowerCase();
                String domain = s.substring(idx1 + 1).toLowerCase();

                StringBuilder sbName = new StringBuilder(name);
                for (int j = 1; j < name.length() - 1; j++) {
                    sbName.setCharAt(j, '*');
                }

                return sbName.toString() + "@" + domain.charAt(0) + "*" * (domain.length() - 2) + domain.charAt(domain.length() - 1);
            }
        }

        String res = "***-***-" + sb.substring(sb.length() - 4, sb.length());
        if (sb.length() == 10) {
            return res;
        } else if (sb.length() > 10 && sb.length() < 13) {
            int len = sb.length();
            String country = "+" + new String(new char[len - 10]).replace('\0', '*');
            return country + "-" + res;
        }

        return "";
