        return dfs(n, n);
    }

    private double dfs(int a, int b) {
        String key = a + "," + b;
        if (memo.containsKey(key)) return memo.get(key);

        if (a <= 0 && b > 0) return 1;
        if (b <= 0) return 0.5;

        double res = 0;
        res += dfs(a - 100, b) * 0.25;
        res += dfs(a - 75, b - 25) * 0.25;
        res += dfs(a - 50, b - 50) * 0.25;
        res += dfs(a - 25, b - 75) * 0.25;

        memo.put(key, res);
        return res;
    }
}

