public class Solution {
    public double new21Game(int n, int k, int w) {
        if (k == 0) return 1;
        double[] dp = new double[k + w + 1];
        dp[0] = 1;
        double sum = 1;
        for (int i = 1; i <= k + w; i++) {
            dp[i] = sum / w;
            if (i < k) sum += dp[i];
            if (i - w >= 0) sum -= dp[i - w];
            if (i > n) break;
        }
        double res = 0;
        for (int i = k; i <= Math.min(n, k + w); i++) {
            res += dp[i];
        }
        return res;
    }
}

