        for (int i = 1; i < s.length(); i++) {
            String x = s.substring(0, i), y = s.substring(i);
            if ((x.charAt(0) == '0' && x.length() > 1)
                    || (y.charAt(y.length() - 1) == '0')) {
                continue;
            }
            res.add(x + "." + y);
        }
        return res;
