public class Solution {
    private static final int[][] DIRECTIONS = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;

        // mark the bricks that will be hit
        for (int[] hit : hits) {
            if (grid[hit[0]][hit[1]] == 1) {
                grid[hit[0]][hit[1]] = -1;
            }
        }

        // simulate the process of dropping bricks
        int[][] copyGrid = new int[m][n];
        for (int i = 0; i < m; i++) {
            System.arraycopy(grid[i], 0, copyGrid[i], 0, n);
        }
        for (int j = 0; j < n; j++) {
            dfs(copyGrid, 0, j);
        }

        int[] result = new int[hits.length];
        int index = hits.length - 1;
        for (int i = m - 1; i >= 0; i--) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == -1) {
                    grid[i][j] = 1;
                    int count = countStableBricks(grid, copyGrid, i, j);
                    result[index--] = count;
                }
            }
        }

        return result;
    }

    private void dfs(int[][] grid, int x, int y) {
        if (x < 0 || x >= grid.length || y < 0 || y >= grid[0].length || grid[x][y] != 1) {
            return;
        }
        grid[x][y] = -1;
        for (int[] direction : DIRECTIONS) {
            dfs(grid, x + direction[0], y + direction[1]);
        }
    }

    private int countStableBricks(int[][] grid, int[][] copyGrid, int x, int y) {
        if (x < 0 || x >= grid.length || y < 0 || y >= grid[0].length || grid[x][y] != 1) {
            return 0;
        }

        // restore the original state
        for (int i = 0; i < grid.length; i++) {
            System.arraycopy(copyGrid[i], 0, grid[i], 0, copyGrid[0].length);
        }

        int count = 0;
