public class Solution {
    public int surfaceArea(int[][] grid) {
        int n = grid.length;
        int area = 0;

        // calculate top and bottom faces
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) {
                    area += grid[i][j] * 2 + 1;
                }
            }
        }

        // calculate left and right faces
        for (int i = 0; i < n; i++) {
            int prev = 0;
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > prev) {
                    area += grid[i][j] - prev;
                }
                prev = grid[i][j];
            }
        }

        // calculate front and back faces
        for (int j = 0; j < n; j++) {
            int prev = 0;
            for (int i = 0; i < n; i++) {
                if (grid[i][j] > prev) {
                    area += grid[i][j] - prev;
                }
                prev = grid[i][j];
            }
        }

        return area;
    }
}

