public class Solution {
    private int maxDepth = 0;
    private TreeNode result = null;

    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        dfs(root, 0);
        return result;
    }

    private int dfs(TreeNode node, int depth) {
        if (node == null) {
            return depth - 1;
        }
        maxDepth = Math.max(maxDepth, depth);
        int leftMaxDepth = dfs(node.left, depth + 1);
        int rightMaxDepth = dfs(node.right, depth + 1);

        if (leftMaxDepth == maxDepth && rightMaxDepth == maxDepth) {
            result = node;
        } else if (node.left != null && leftMaxDepth == maxDepth) {
            result = node.left;
        } else if (node.right != null && rightMaxDepth == maxDepth) {
            result = node.right;
        }
        return Math.max(leftMaxDepth, rightMaxDepth);
    }
}

