public class Solution {
    public String pushDominoes(String dominoes) {
        char[] res = new char[dominoes.length()];
        int left = 0, right = 0;

        while (right < dominoes.length()) {
            if (dominoes.charAt(right) == 'L') {
                for (int i = left; i <= right; i++) {
                    res[i] = 'L';
                }
                left = right + 1;
            } else if (dominoes.charAt(right) == 'R') {
                int mid = (left + right) / 2;
                for (int i = left; i < mid; i++) {
                    res[i] = 'R';
                }
                for (int i = mid + 1; i <= right; i++) {
                    res[i] = 'L';
                }
                left = right + 1;
            }
            right++;
        }

        // handle the last sequence of 'R's
        if (left < dominoes.length()) {
            for (int i = left; i < dominoes.length(); i++) {
                res[i] = 'R';
            }
        }

        return new String(res);
    }
}

