public class Solution {
    public boolean reorderedPowerOf2(int n) {
        Map<Integer, Integer> count = countDigits(n);
        int maxPow = 0;
        while (Math.pow(2, maxPow) <= Math.pow(10, String.valueOf(n).length())) {
            maxPow++;
        }

        for (int i = 0; i < maxPow; i++) {
            Map<Integer, Integer> powCount = countDigits((int)Math.pow(2, i));
            if (count.equals(powCount)) {
                return true;
            }
        }

        return false;
    }

    private Map<Integer, Integer> countDigits(int n) {
        Map<Integer, Integer> count = new HashMap<>();
        while (n > 0) {
            int digit = n % 10;
            count.put(digit, count.getOrDefault(digit, 0) + 1);
            n /= 10;
        }

        return count;
    }
}

