    private boolean isStretchy(String s, String word) {
        int i = 0, j = 0;
        while (i < s.length() && j < word.length()) {
            if (s.charAt(i) != word.charAt(j)) {
                return false;
            }
            int countS = countConsecutive(s, i);
            int countWord = countConsecutive(word, j);
            if (countS < 3 && countS != countWord || 
                countS >= 3 && countS < countWord) {
                return false;
            }
            i += countS;
            j += countWord;
        }
        return i == s.length() && j == word.length();
    }

    private int countConsecutive(String str, int index) {
        char c = str.charAt(index);
        int count = 0;
        while (index < str.length() && str.charAt(index) == c) {
            count++;
            index++;
        }
        return count;
    }
}

