// #Hard #String #Breadth_First_Search #2022_03_27_Time_2_ms_(99.58%)_Space_42.6_MB_(97.17%)
public class Solution {
    public int kSimilarity(String a, String b) {
        Queue<String> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();

        queue.offer(a);
        visited.add(a);

        int step = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                String cur = queue.poll();

                if (cur.equals(b)) return step;

                for (String next : swap(cur, b)) {
                    if (!visited.contains(next)) {
                        visited.add(next);
                        queue.offer(next);
                    }
                }
            }

            step++;
        }

        return -1;
    }

    private List<String> swap(String s, String target) {
        List<String> res = new ArrayList<>();
        char[] chars = s.toCharArray();
        int i = 0;

        while (i < s.length() && s.charAt(i) == target.charAt(i)) i++;

        for (int j = i + 1; j < s.length(); j++) {
            if (s.charAt(j) == target.charAt(i)) {
                swap(chars, i, j);
                res.add(new String(chars));
                swap(chars, i, j); // backtrack
            }
        }

        return res;
    }

    private void swap(char[] chars, int i, int j) {
        char temp = chars[i];
        chars[i] = chars[j];
        chars[j] = temp;
    }
}

