public class Solution {
    public int numSimilarGroups(String[] strs) {
        int n = strs.length;
        boolean[][] similar = new boolean[n][n];

        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (isSimilar(strs[i], strs[j])) {
                    similar[i][j] = true;
                    similar[j][i] = true;
                }
            }
        }

        int[] groupIds = new int[n];
        for (int i = 0; i < n; i++) {
            groupIds[i] = i;
        }

        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (similar[i][j]) {
                    union(groupIds, i, j);
                }
            }
        }

        int count = 0;
        for (int i = 0; i < n; i++) {
            if (groupIds[i] == i) {
                count++;
            }
        }

        return count;
    }

    private boolean isSimilar(String s1, String s2) {
        int diffCount = 0;
        for (int i = 0; i < s1.length(); i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                diffCount++;
                if (diffCount > 2) {
                    return false;
                }
            }
        }
        return true;
    }

    private void union(int[] groupIds, int x, int y) {
        int groupIdX = find(groupIds, x);
        int groupIdY = find(groupIds, y);

        if (groupIdX != groupIdY) {
            groupIds[groupIdY] = groupIdX;
        }
    }

    private int find(int[] groupIds, int x) {
        while (groupIds[x] != x) {
            x = groupIds[x];
        }
        return x;
    }
}

