public class Solution {
    public int matrixScore(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        for (int i = 0; i < m; i++) {
            if (grid[i][0] == 0) {
                flipRow(grid, i);
            }
        }

        for (int j = 1; j < n; j++) {
            int count = 0;
            for (int i = 0; i < m; i++) {
                if (grid[i][j] == grid[i][0]) {
                    count++;
                }
            }
            if (count < m / 2) {
                flipCol(grid, j);
            }
        }

        int score = 0;
        for (int[] row : grid) {
            int num = 0;
            for (int k = n - 1; k >= 0; k--) {
                if (row[k] == 1) {
                    num += Math.pow(2, n - 1 - k);
                }
            }
            score += num;
        }

        return score;
    }

    private void flipRow(int[][] grid, int row) {
        for (int j = 0; j < grid[0].length; j++) {
            grid[row][j] ^= 1;
        }
    }

    private void flipCol(int[][] grid, int col) {
        for (int i = 0; i < grid.length; i++) {
            grid[i][col] ^= 1;
        }
    }
}

