        for (int child : graph[node]) {
            if (child != parent) {
                dfs(graph, child, node, count);
                count[node] += count[child];
            }
        }
        count[node]++;
    }

    private void dfs2(List<Integer>[] graph, int node, int parent, int n, int[] count, int[] res) {
        for (int child : graph[node]) {
            if (child != parent) {
                res[child] = res[node] - count[child] + (n - count[child]);
                dfs2(graph, child, node, n, count, res);
            }
        }
    }
}

