public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int rectangleArea(int[][] rectangles) {
        List<Integer> xCoords = new ArrayList<>();
        for (int[] rect : rectangles) {
            xCoords.add(rect[0]);
            xCoords.add(rect[2]);
        }
        Collections.sort(xCoords);
        xCoords = removeDuplicates(xCoords);

        long area = 0;
        for (int y1 : getYValues(rectangles, xCoords)) {
            for (int y2 : getYValues(rectangles, xCoords)) {
                if (y1 > y2) continue;

                int[] activeRects = getActiveRects(rectangles, y1, y2);
                area += calculateArea(activeRects, xCoords);
                area %= MOD;
            }
        }

        return (int) area;
    }

    private List<Integer> removeDuplicates(List<Integer> list) {
        List<Integer> result = new ArrayList<>();
        for (Integer value : list) {
            if (!result.contains(value)) {
                result.add(value);
            }
        }
        return result;
    }

    private int[] getYValues(int[][] rectangles, List<Integer> xCoords) {
        Set<Integer> yValues = new HashSet<>();
        for (int[] rect : rectangles) {
            if (xCoords.get(0) >= rect[0] && xCoords.get(xCoords.size() - 1) <= rect[2]) {
                yValues.add(rect[1]);
                yValues.add(rect[3]);
            }
        }

        int[] result = new int[yValues.size()];
        int i = 0;
        for (Integer value : yValues) {
            result[i++] = value;
        }
        Arrays.sort(result);
        return result;
    }

    private int[] getActiveRects(int[][] rectangles, int y1, int y2) {
        List<int[]> activeRects = new ArrayList<>();
        for (int[] rect : rectangles) {
            if (rect[1] <= y1 && rect[3] >= y2) {
                activeRects.add(rect);
            }
        }

        int[] result = new int[activeRects.size()];
        for (i = 0; i < activeRects.size(); i++) {
            result[i] = activeRects.get(i)[0];
        }
        Arrays.sort(result);
        return result;
    }

    private long calculateArea(int[] activeRects, List<Integer> xCoords) {
        int n = activeRects.length;
        if (n == 0) return 0;

        long area = 0;
        for (int i = 1; i < xCoords.size(); i++) {
            int left = xCoords.get(i - 1);
            int right = xCoords.get(i);

            int start = Arrays.binarySearch(activeRects, left);
            if (start < 0) start = ~start;

            int end = Arrays.binarySearch(activeRects, right);
            if (end < 0) end = ~end;

            area += (right - left) * (long) (end - start);
        }

        return area;
    }
}

