                        dp[i][j] += dp[i - 1][k];
                        dp[i][j] %= MOD;
                    }
                }
            }
        }

        long sum = 0;
        for (int i = 1; i <= 6; i++) {
            sum += dp[n][i];
            sum %= MOD;
        }
        return (int) sum;
    }

    private int lastPos(long[][] dp, int val, int row) {
        for (int i = row - 1; i >= 0; i--) {
