public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numberOfWays(int startPos, int endPos, int k) {
        int diff = Math.abs(endPos - startPos);

        if (diff > k || ((k - diff) & 1) == 1)
            return 0;

        long res = combination(k, (k + diff) / 2);

        return (int) (res % MOD);
    }

    private long combination(int n, int r) {
        long[] factorial = new long[n + 1];

        factorial[0] = 1;

        for (int i = 1; i <= n; ++i)
            factorial[i] = (factorial[i - 1] * i) % MOD;

        return (factorial[n] * pow(factorial[r], MOD - 2, MOD)) % MOD
                * pow(factorial[n - r], MOD - 2, MOD) % MOD;
    }

    private long pow(long x, int n, int mod) {
        if (n == 0)
            return 1;

        long t = pow(x, n / 2, mod);

        if ((n & 1) == 0)
            return (t * t) % mod;

        return (((t * t) % mod) * x) % mod;
    }
}

