import com_github_leetcode.TreeNode;

public class Solution {
    public int amountOfTime(TreeNode root, int start) {
        if (root == null) return 0;

        int[] res = new int[1];
        dfs(root, false, start, res);
        return res[0];
    }

    private void dfs(TreeNode node, boolean isInfected, int start, int[] res) {
        if (node == null) return;

        if (!isInfected && node.val != start) {
            dfs(node.left, false, start, res);
            dfs(node.right, false, start, res);
            return;
        }

        boolean leftInfected = false, rightInfected = false;
        if (node.left != null) {
            if (node.left.val == start || isInfected) {
                leftInfected = true;
                dfs(node.left, true, start, res);
            } else {
                dfs(node.left, false, start, res);
            }
        }

        if (node.right != null) {
            if (node.right.val == start || isInfected) {
                rightInfected = true;
                dfs(node.right, true, start, res);
            } else {
                dfs(node.right, false, start, res);
            }
        }

        if ((leftInfected && !rightInfected) || (!leftInfected && rightInfected)) {
            res[0]++;
        } else if (!leftInfected && !rightInfected) {
            res[0] += 2;
        }
    }
}

