public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        int n = edges.length;
        boolean[] vis1 = new boolean[n];
        boolean[] vis2 = new boolean[n];

        dfs(node1, vis1, edges);
        dfs(node2, vis2, edges);

        int res = -1;
        int minSum = Integer.MAX_VALUE;

        for (int i = 0; i < n; ++i) {
            if (vis1[i] && vis2[i]) {
                int sum = getDist(i, node1, vis1, edges) + getDist(i, node2, vis2, edges);
                if (sum < minSum || (sum == minSum && (res == -1 || i < res))) {
                    minSum = sum;
                    res = i;
                }
            }
        }

        return res;
    }

    private void dfs(int cur, boolean[] vis, int[] edges) {
        while (!vis[cur]) {
            vis[cur] = true;
            if (edges[cur] != -1) {
                cur = edges[cur];
            } else {
                break;
            }
        }
    }

    private int getDist(int tar, int src, boolean[] vis, int[] edges) {
        int dist = 0;
        while (src != tar && src != -1) {
            if (vis[src]) return dist;
            ++dist;
            src = edges[src];
        }
        return src == tar ? dist : Integer.MAX_VALUE / 2;
    }
}

