public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int peopleAwareOfSecret(int n, int delay, int forget) {
        long[] dp = new long[forget + 1];
        dp[0] = 1;

        for (int i = 1; i <= n; i++) {
            if (i >= delay) {
                dp[i % forget] += dp[(i - delay) % forget];
                dp[i % forget] %= MOD;
            }

            if (i > forget) {
                dp[i % forget] -= dp[(i - forget - 1) % forget];
                dp[i % forget] = (dp[i % forget] + MOD) % MOD;
            }
        }

        long res = 0;
        for (int i = delay; i <= n && i < forget; i++) {
            res += dp[i % forget];
            res %= MOD;
        }

        return (int) res;
    }
}

