    private int helper(int[] nums1, int[] nums2) {
        int n = nums1.length;
        long maxSoFar = 0, minSoFar = 0;
        long maxEndingHere = 0, minEndingHere = 0;

        for (int i = 0; i < n; i++) {
            maxEndingHere += nums2[i] - nums1[i];
            if (maxEndingHere > maxSoFar) {
                maxSoFar = maxEndingHere;
            }
            if (maxEndingHere < 0) {
                maxEndingHere = 0;
            }

            minEndingHere += nums1[i] - nums2[i];
            if (minEndingHere < minSoFar) {
                minSoFar = minEndingHere;
            }
            if (minEndingHere > 0) {
                minEndingHere = 0;
            }
        }

        return (int)(Math.max(maxSoFar, -minSoFar) + sum(nums1));
    }

