// #2022_06_16_Time_14_ms_(84.35%)_Space_39.6_MB_(92.46%)
public class Solution {
    public int distributeCookies(int[] cookies, int k) {
        Arrays.sort(cookies);
        int n = cookies.length;
        int[] children = new int[k];

        return backtrack(children, cookies, n - 1);
    }

    private int backtrack(int[] children, int[] cookies, int index) {
        if (index < 0) {
            return getMax(children);
        }

        int min = Integer.MAX_VALUE;
        for (int i = 0; i < children.length; i++) {
            children[i] += cookies[index];
            int max = backtrack(children, cookies, index - 1);
            min = Math.min(min, max);
            children[i] -= cookies[index];

            if (min == getMax(children)) break;
        }

        return min;
    }

    private int getMax(int[] nums) {
        int max = Integer.MIN_VALUE;
        for (int num : nums) {
            max = Math.max(max, num);
        }
        return max;
    }
}

