public class Solution {
    public int validSubarraySize(int[] nums, int threshold) {
        int k = nums.length;
        for (int i = 0; i < k; i++) {
            if (nums[i] > threshold / k) {
                return k;
            }
        }
        for (int len = k - 1; len >= 1; len--) {
            double minRequired = (double) threshold / len;
            int left = 0, right = 0;
