public class Solution {
    public int countSpecialNumbers(int n) {
        String str = Integer.toString(n);
        int res = 0, m = str.length();
        boolean[] seen = new boolean[10];

        // calculate number of special numbers with less digits than n
        for (int i = 1; i < m; ++i)
            res += 9 * perm(9, i - 1);

        // calculate number of special numbers with same digits as n
        int[] nums = new int[m];
        for (int i = 0; i < m; ++i) {
            nums[i] = str.charAt(i) - '0';
            seen[nums[i]] = true;
        }

        res += perm(10, m);
        for (int i = 0; i < m; ++i) {
            if (i > 0 && nums[i] == nums[i - 1]) break;
            int count = 0;
            for (int j = 0; j < nums[i]; ++j)
                if (!seen[j])
                    count++;
            res -= perm(10 - i - 1, m - i - 1) * count;
        }

        return res + 1;
    }

    // calculate permutation
    private int perm(int n, int r) {
        int res = 1;
        for (int i = n; i > n - r; --i)
            res *= i;
        return res;
    }
}

