public class Solution {
    public int[] maximumSegmentSum(int[] nums, int[] removeQueries) {
        int n = nums.length;
        TreeMap<Integer, long[]> map = new TreeMap<>();
        long[] max = new long[n + 1];
        long sum = 0;
        for (int i = 0; i < n; i++) {
            sum += nums[i];
            map.put(i, new long[]{sum, sum});
            max[1] = Math.max(max[1], sum);
        }

        int[] res = new int[n];
        for (int i = n - 1; i >= 0; i--) {
            int idx = removeQueries[i];
            long[] left = map.lowerEntry(idx) != null ? map.get(map.lowerEntry(idx).getKey()) : new long[]{0, 0};
            long[] right = map.higherEntry(idx) != null ? map.get(map.higherEntry(idx).getKey()) : new long[]{0, 0};

            if (left[1] > 0 && right[1] > 0) {
                long[] val = {left[0], left[1] + right[1]};
                max[1] = Math.max(max[1], val[1]);
                map.put(left[0] == 0 ? right[0] : left[0], val);
            }

            if (map.lowerEntry(idx) != null)
                map.remove(map.lowerEntry(idx).getKey());
            if (map.higherEntry(idx) != null)
                map.remove(map.higherEntry(idx).getKey());
            res[i] = (int) max[1];
        }

        return res;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        int[] nums = {3, 2, 5, 4};
        int[] removeQueries = {0, 2, 1, 3};
        System.out.println(Arrays.toString(solution.maximumSegmentSum(nums, removeQueries)));
    }
}

