import java.util.Arrays;
public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int idealArrays(int n, int maxValue) {
        int[][] dp = new int[n][maxValue + 1];
        for (int i = 1; i <= maxValue; i++) {
            dp[0][i] = 1;
        }

        for (int i = 1; i < n; i++) {
            long[] prefixSum = new long[maxValue + 2];
            for (int j = 1; j <= maxValue; j++) {
                prefixSum[j] += dp[i - 1][j];
                if (j > 1) {
                    prefixSum[j] += prefixSum[j - 1];
                }
                prefixSum[j] %= MOD;
            }

            for (int j = 1; j <= maxValue; j++) {
                int k = 1;
                while (k * k < j) {
                    if (j % k == 0) {
                        dp[i][j] += prefixSum[Math.min(maxValue, j / k)];
                        dp[i][j] %= MOD;
                    }
                    k++;
                }

                if (k * k == j && k <= maxValue) {
                    dp[i][j] += prefixSum[k];
                    dp[i][j] %= MOD;
                }
            }
        }

        long res = 0;
        for (int i = 1; i <= maxValue; i++) {
            res += dp[n - 1][i];
            res %= MOD;
        }

        return (int) res;
    }
}

