public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        long sum = 0;

        for (int i = 0; i < nums1.length; i++) {
            int diff = Math.abs(nums1[i] - nums2[i]);
            if (diff > 0) {
                pq.offer(diff);
                sum += (long) diff * diff;
            }
        }

        long kSum = k1 + k2;
        while (!pq.isEmpty() && kSum > 0) {
            int top = pq.poll();
            int reduce = Math.min(kSum, top - 1);
            sum -= (long) (top * top - (top - reduce) * (top - reduce));
            kSum -= reduce;
            if (top - reduce > 1) {
                pq.offer(top - reduce);
            }
        }

        return sum;
    }
}

