            for (int mask = 0; mask < (1 << n); mask++) {
                if ((rowMask[i] & mask) == rowMask[i]) {
                    dp[mask]++;
                }
            }
        }

        int[] maxRows = new int[numSelect + 1];
        for (int i = 0; i <= numSelect; i++) {
            for (int mask = 0; mask < (1 << n); mask++) {
                if (Integer.bitCount(mask) == i) {
                    for (int subMask = mask; ; subMask = (subMask - 1) & mask) {
                        maxRows[i] = Math.max(maxRows[i], dp[subMask]);
                        if (subMask == 0) break;
                    }
                }
            }
        }

        return maxRows[numSelect];
    }
}

