import java.util.ArrayList;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Queue;

public class Solution {
    // Using topological sort to solve this problem
    public int[][] buildMatrix(int k, int[][] rowConditions, int[][] colConditions) {
        List<Integer>[] graphRow = new ArrayList[k + 1];
        List<Integer>[] graphCol = new ArrayList[k + 1];

        for (int i = 0; i <= k; i++) {
            graphRow[i] = new ArrayList<>();
            graphCol[i] = new ArrayList<>();
        }

        int[] indegreeRow = new int[k + 1];
        int[] indegreeCol = new int[k + 1];

        // Build the graph
        for (int[] row : rowConditions) {
            graphRow[row[0]].add(row[1]);
            indegreeRow[row[1]]++;
        }

        for (int[] col : colConditions) {
            graphCol[col[0]].add(col[1]);
            indegreeCol[col[1]]++;
        }

        // Topological sort
        Queue<Integer> queue = new LinkedList<>();
        List<Integer> orderRow = new ArrayList<>();
        List<Integer> orderCol = new ArrayList<>();

        for (int i = 1; i <= k; i++) {
            if (indegreeRow[i] == 0) {
                queue.offer(i);
            }
        }

        while (!queue.isEmpty()) {
            int node = queue.poll();
            orderRow.add(node);

            for (int neighbor : graphRow[node]) {
                indegreeRow[neighbor]--;
                if (indegreeRow[neighbor] == 0) {
                    queue.offer(neighbor);
                }
            }
        }

        queue.clear();

        for (int i = 1; i <= k; i++) {
            if (indegreeCol[i] == 0) {
                queue.offer(i);
            }
        }

        while (!queue.isEmpty()) {
            int node = queue.poll();
            orderCol.add(node);

            for (int neighbor : graphCol[node]) {
                indegreeCol[neighbor]--;
                if (indegreeCol[neighbor] == 0) {
                    queue.offer(neighbor);
                }
            }
        }

        // Check if there's a cycle
        if (orderRow.size() != k || orderCol.size() != k) {
            return new int[][] {};
        }

        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < k; i++) {
            map.put(orderCol.get(i), i);
        }

        int[][] matrix = new int[k][k];
        for (int i = 0; i < k; i++) {
            matrix[i][map.get(orderRow.get(i))] = orderRow.get(i);
        }

        return matrix;
    }
}

