public class Solution {
    public int minimumNumbers(int num, int k) {
        // Base Case Check
        if (num == 0) return 0;

        // check if the unit digits are equal for any case and if n>k*i
        if (num % 10 != k && num < k * 1) return -1;

        int min = Integer.MAX_VALUE;
        for (int i = 1; ; i++) {
            int currNum = k * i;
            if (currNum > num) break;

            // check if the remaining number can be formed with unit digit k
            if ((num - currNum) % 10 == k || (num - currNum) == 0) {
                min = Math.min(min, i + minimumNumbers(num - currNum, k));
            }
        }

        return min == Integer.MAX_VALUE ? -1 : min;
    }
}

