public class Solution {
    public int latestTimeCatchTheBus(int[] buses, int[] passengers, int capacity) {
        Arrays.sort(buses);
        Arrays.sort(passengers);

        int lastBus = buses[buses.length - 1];
        int capcity = capacity;
        for (int i = passengers.length - 1; i >= 0 && capcity > 0; i--) {
            if (passengers[i] <= lastBus) {
                capcity--;
                lastBus = passengers[i];
            }
        }

        if (capcity == capacity) {
            return buses[buses.length - 1];
