public class Solution {
    public int unequalTriplets(int[] nums) {
        Map<Integer, Integer> countMap = new HashMap<>();

        for (int num : nums) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
        }

        long total = 0;
        long sum = 0;

        for (int value : countMap.values()) {
            if (value > 2) {
                total += (long) value * (value - 1) * (value - 2);
            } else if (value == 2) {
                total += (long) value * (value - 1);
            }

            sum += value;
        }

        long result = ((sum * (sum - 1)) / 2) * (sum - 2) - total;

        return (int) result;
    }
}

