                evenNums[e++] = nums[i];
            }

            if ((target[i] & 1) == 1) {
                oddTarget[o - 1] = target[i];
            } else {
                evenTarget[e - 1] = target[i];
            }
        }

        Arrays.sort(evenNums, 0, e);
        Arrays.sort(oddNums, 0, o);
        Arrays.sort(evenTarget, 0, e);
        Arrays.sort(oddTarget, 0, o);

        long res = 0;
        for (int i = 0; i < e; ++i) {
            if (evenNums[i] != evenTarget[i]) res += Math.abs(evenNums[i] - evenTarget[i]) / 2;
        }

        for (int i = 0; i < o; ++i) {
            if (oddNums[i] != oddTarget[i]) res += Math.abs(oddNums[i] - oddTarget[i]) / 2;
        }

        return res;
    }
}

