import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int[] treeQueries(TreeNode root, int[] queries) {
        Map<TreeNode, Integer> heightMap = new HashMap<>();
        dfs(root, 0, heightMap);

        int n = queries.length;
        int[] res = new int[n];
        for (int i = 0; i < n; i++) {
            TreeNode node = findNode(root, queries[i]);
            if (node == null) continue;

            int leftHeight = getHeight(node.left, heightMap);
            int rightHeight = getHeight(node.right, heightMap);
            res[i] = Math.max(leftHeight, rightHeight);
        }

        return res;
    }

    private void dfs(TreeNode node, int height, Map<TreeNode, Integer> heightMap) {
        if (node == null) return;

        heightMap.put(node, height);
        dfs(node.left, height + 1, heightMap);
        dfs(node.right, height + 1, heightMap);
    }

    private TreeNode findNode(TreeNode node, int val) {
        if (node == null || node.val == val) return node;

        TreeNode left = findNode(node.left, val);
        if (left != null) return left;

        return findNode(node.right, val);
    }

    private int getHeight(TreeNode node, Map<TreeNode, Integer> heightMap) {
        if (node == null) return -1;

        return heightMap.getOrDefault(node, 0);
    }
}

