public class Solution {
    public String oddString(String[] words) {
        int n = words.length;
        String firstWord = words[0];
        int[] diff1 = getDiff(firstWord);

        if (n == 1) return firstWord;

        String secondWord = words[1];
        int[] diff2 = getDiff(secondWord);

        if (!same(diff1, diff2)) {
            if (same(getDiff(words[2]), diff2)) 
                return firstWord;
            else 
                return secondWord;
        }

        for (int i = 2; i < n; i++) {
            int[] currDiff = getDiff(words[i]);
            if (!same(diff1, currDiff)) 
                return words[i];
        }

        return "";
    }

    private boolean same(int[] a, int[] b) {
        for (int i = 0; i < a.length; i++) {
            if (a[i] != b[i]) 
                return false;
        }
        return true;
    }

    private int[] getDiff(String word) {
        char[] chars = word.toCharArray();
        int n = chars.length - 1;
        int[] diff = new int[n];

        for (int i = 0; i < n; i++) 
            diff[i] = chars[i + 1] - chars[i];

        return diff;
    }
}

