        int j = 0, k = f.length - 1;

        // As we don't know the implementation of the List that is passed, it is better to map it to
        // an array explicitly
        for (int i = r.length - 1; i >= 0 && k >= 0; i--) {
            while (j < f.length && f[j][1] == 0) j++;
            if (f[k][0] > r[i]) {
