// #Hard #String #Dynamic_Programming #Hash_Function #String_Matching #Rolling_Hash
// #2022_12_07_Time_159_ms_(93.39%)_Space_42.7_MB_(79.28%)
import java.util.HashMap;

public class Solution {
    public int deleteString(String s) {
        int n = s.length();
        int[] dp = new int[n + 1];
        for (int i = n - 1; i >= 0; --i) {
            String subStr = s.substring(i, Math.min(n, i * 2 + 1));
            HashMap<Character, Integer> map = new HashMap<>();
            long hashVal = 0;
            int base = 26;
            for (int j = 0; j < subStr.length(); ++j) {
                char c = subStr.charAt(j);
                if (!map.containsKey(c)) {
                    map.put(c, map.size());
                }
                hashVal = hashVal * base + map.get(c);
            }
            int maxLen = 1;
            for (int len = 2; len <= subStr.length(); ++len) {
                long newHashVal = hashVal % (long) Math.pow(base, len - 1);
                if (hashVal == newHashVal * (long) Math.pow(base, subStr.length() - len) + hashVal / (long) Math.pow(base, subStr.length() - len)) {
                    maxLen = len;
                }
            }
            dp[i] = dp[Math.min(n, i + maxLen)] + 1;
        }
        return dp[0];
    }
}

