// #Medium #Array #Two_Pointers #Heap_Priority_Queue #Simulation
// #2023_01_07_Time_57_ms_(96.24%)_Space_54_MB_(92.26%)
import java.util.PriorityQueue;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        PriorityQueue<Integer> left = new PriorityQueue<>((a, b) -> a.equals(b) ? Integer.compare(costs[a], costs[b]) : Integer.compare(a, b));
        PriorityQueue<Integer> right = new PriorityQueue<>((a, b) -> a.equals(b) ? Integer.compare(costs[a], costs[b]) : Integer.compare(a, b));

        for (int i = 0; i < candidates && i < costs.length; i++) {
            left.offer(i);
        }

        int j = Math.max(0, costs.length - candidates);

        for (; j < costs.length; j++) {
            right.offer(j);
        }

        long totalCost = 0;

        while (k-- > 0) {
            if (!left.isEmpty() && (right.isEmpty() || costs[left.peek()] <= costs[right.peek()])) {
                totalCost += costs[left.poll()];
                if (++j < costs.length) {
                    left.offer(j);
                }
            } else {
                totalCost += costs[right.poll()];
                if (candidates-- > 0) {
                    right.offer(--j);
                }
            }
        }

        return totalCost;
    }
}

