public class Solution {
    public List<List<String>> mostPopularCreator(String[] creators, String[] ids, int[] views) {
        Map<String, Long> creatorViews = new HashMap<>();
        Map<String, String> maxViewedVideo = new HashMap<>();

        for (int i = 0; i < creators.length; i++) {
            long currentViews = creatorViews.getOrDefault(creators[i], 0L);
            creatorViews.put(creators[i], currentViews + views[i]);

            if (!maxViewedVideo.containsKey(creators[i]) || views[i] > Arrays.stream(views).filter(view -> creators[Arrays.asList(ids).indexOf(view)] == creators[i]).max().getAsInt()) {
                maxViewedVideo.put(creators[i], ids[i]);
            } else if (views[i] == Arrays.stream(views).filter(view -> creators[Arrays.asList(ids).indexOf(view)] == creators[i]).max().getAsInt() && ids[i].compareTo(maxViewedVideo.get(creators[i])) < 0) {
                maxViewedVideo.put(creators[i], ids[i]);
            }
        }

        long maxViews = creatorViews.values().stream().max(Long::compare).get();
        List<List<String>> result = new ArrayList<>();

        for (Map.Entry<String, Long> entry : creatorViews.entrySet()) {
            if (entry.getValue() == maxViews) {
                List<String> temp = new ArrayList<>();
                temp.add(entry.getKey());
                temp.add(maxViewedVideo.get(entry.getKey()));
                result.add(temp);
            }
        }

        return result;
    }
}

