public class Solution {
    public int maxJump(int[] stones) {
        int n = stones.length;
        return helper(stones, 0, n - 1);
    }

    private int helper(int[] stones, int left, int right) {
        if (left == right) {
            return 0;
        }
        int mid = left + (right - left) / 2;
        int res = Math.max(helper(stones, left, mid), helper(stones, mid + 1, right));
        int maxJump = stones[right] - stones[left];
        for (int i = left; i <= mid; i++) {
            int jump = stones[i] - stones[left];
            int nextJump = stones[right] - stones[i];
            res = Math.max(res, Math.min(maxJump, Math.max(jump, nextJump)));
        }
        return res;
    }
}

