        int[][][] ways = new int[m + 1][n + 1][k];
        ways[0][0][grid[0][0] % k]++;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (i == 0 && j == 0) continue;
                int sum = grid[i][j];
                if (i > 0) {
                    for (int l = 0; l < k; l++) {
                        ways[i][j][(l + sum) % k] += ways[i - 1][j][l];
                        ways[i][j][(l + sum) % k] %= MOD;
                    }
                }
                if (j > 0) {
                    for (int l = 0; l < k; l++) {
                        ways[i][j][(l + sum) % k] += ways[i][j - 1][l];
                        ways[i][j][(l + sum) % k] %= MOD;
                    }
                }
            }
        }

        return ways[m - 1][n - 1][0];
    }
