    private Map<Integer, List<Integer>> graph;

    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        buildGraph(edges);
        dfs(0, -1, 0, new boolean[edges.length + 1], amount, bob, 0);
        return maxProfit;
    }

    private void buildGraph(int[][] edges) {
        graph = new HashMap<>();
        for (int[] edge : edges) {
            graph.computeIfAbsent(edge[0], k -> new ArrayList<>()).add(edge[1]);
            graph.computeIfAbsent(edge[1], k -> new ArrayList<>()).add(edge[0]);
        }
    }

    private void dfs(int node, int parent, long currentProfit, boolean[] visited, int[] amount, int bob, int time) {
        if (node == bob && time > 0) return;
        visited[node] = true;

        if (graph.get(node).size() == 1 && graph.get(node).get(0) == parent) {
            maxProfit = Math.max(maxProfit, currentProfit + amount[node]);
            return;
        }

        for (int neighbor : graph.get(node)) {
            if (!visited[neighbor]) {
                long profit = amount[node];
                if (node != 0 && time == bobTime(neighbor, bob, new boolean[amount.length], -1, 0)) {
                    profit /= 2;
                }
                dfs(neighbor, node, currentProfit + profit, visited, amount, bob, time + 1);
            }
        }

        visited[node] = false;
    }

    private int bobTime(int node, int bob, boolean[] visited, int parent, int time) {
        if (node == bob) return time;
        visited[node] = true;

        for (int neighbor : graph.get(node)) {
            if (!visited[neighbor]) {
                int result = bobTime(neighbor, bob, visited, node, time + 1);
                if (result != -1) return result;
            }
        }

        return -1;
    }
}

