            return n - 1;
        }

        for (int i = n; i >= 2; i--) {
            if (sum % i != 0) continue;
            if (dfs(graph, new boolean[n], nums, sum / i, 0, -1)) {
                return n - i;
            }
        }

        return 0;
    }

    private boolean dfs(List<Integer>[] graph, boolean[] visited, int[] nums, long target, int u, int p) {
        visited[u] = true;
        long sum = nums[u];

        for (int v : graph[u]) {
            if (v == p || visited[v]) continue;
            sum += dfs(graph, visited, nums, target, v, u);
        }

        return sum % target == 0;
    }
