public class Solution {
    public int numberOfGoodPaths(int[] vals, int[][] edges) {
        int n = vals.length;
        List<Integer>[] adj = new List[n];
        for (int i = 0; i < n; i++) {
            adj[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            adj[edge[0]].add(edge[1]);
            adj[edge[1]].add(edge[0]);
        }

        int[][] maxVals = new int[n][2];
        for (int i = 0; i < n; i++) {
            maxVals[i] = new int[] {vals[i], i};
        }

        Arrays.sort(maxVals, Comparator.comparingInt(a -> a[0]));

        UnionFind uf = new UnionFind(n);
        int res = 0;
        for (int[] pair : maxVals) {
            int val = pair[0];
            int node = pair[1];

            for (int nei : adj[node]) {
                if (vals[nei] <= val) {
                    uf.union(node, nei);
                }
            }

            res += uf.size[node] - 1;
        }

        return res + n;
    }

    class UnionFind {
        int[] parent;
        int[] size;

        public UnionFind(int n) {
            parent = new int[n];
            size = new int[n];

            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        public void union(int x, int y) {
            int rootX = find(x);
            int rootY = find(y);

            if (rootX != rootY) {
                parent[rootY] = rootX;
                size[rootX] += size[rootY];
            }
        }

        public int find(int x) {
            if (parent[x] == x) return x;

            return parent[x] = find(parent[x]);
        }
    }
}

