public class Solution {
    public int magnificentSets(int n, int[][] edges) {
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 0; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }

        int maxGroupCount = 0;
        boolean[] visited = new boolean[n + 1];
        for (int i = 1; i <= n; i++) {
            if (!visited[i]) {
                Queue<Integer> queue = new LinkedList<>();
                queue.offer(i);
                visited[i] = true;

                int groupCount = 0;
                while (!queue.isEmpty()) {
                    int size = queue.size();
                    for (int j = 0; j < size; j++) {
                        int node = queue.poll();

                        if (graph[node].isEmpty()) continue;

                        boolean isPossible = true;
                        for (int neighbor : graph[node]) {
                            if (visited[neighbor] && Math.abs(groupCount - getGroup(neighbor, visited)) != 1) {
                                isPossible = false;
                                break;
                            }
                        }

                        if (!isPossible) return -1;

                        for (int neighbor : graph[node]) {
                            if (!visited[neighbor]) {
                                queue.offer(neighbor);
                                visited[neighbor] = true;
                                setGroup(neighbor, groupCount + 1, visited);
                            }
                        }
                    }
                    groupCount++;
                }

                maxGroupCount = Math.max(maxGroupCount, groupCount);
            }
        }

        return maxGroupCount;
    }

    private int getGroup(int node, boolean[] visited) {
        if (visited[node] == false) return 0;
        else return (node % 2 == 1) ? 1 : -1;
    }

    private void setGroup(int node, int group, boolean[] visited) {
        if (group > 0) visited[node] = true;
        else visited[node] = false;
    }
}

