            if (meetings[i][0] >= top[1]) {
                pq.offer(new int[]{top[0], meetings[i][0]});
                count[top[0]]++;
            } else {
                int[] next = pq.poll();
                pq.offer(top);
                pq.offer(new int[]{next[0], Math.max(next[1], meetings[i][0]) + (meetings[i][1] - meetings[i][0])});
                count[next[0]]++;
            }
        }

        int maxCount = 0;
        for (int i = 1; i < n; i++) {
            if (count[maxCount] < count[i]) {
                maxCount = i;
            }
        }

        return maxCount;
    }
