public class Solution {
    public String[] splitMessage(String message, int limit) {
        int n = message.length();
        int low = 1;
        int high = n + (n / limit) + 5; // max possible number of parts

        while (low <= high) {
            int mid = low + (high - low) / 2;
            if (canSplit(message, limit, mid)) {
                high = mid - 1;
            } else {
                low = mid + 1;
            }
        }

        return splitMessage(message, limit, low);
    }

    private boolean canSplit(String message, int limit, int parts) {
        int length = message.length();
        for (int i = 1; i <= parts; i++) {
            int partLength = length / parts + (i == 1 ? length % parts : 0);
            if (partLength > limit - String.valueOf(parts).length() - String.valueOf(i).length() - 3) {
                return false;
            }
        }
        return true;
    }

    private String[] splitMessage(String message, int limit, int parts) {
        String[] result = new String[parts];
        for (int i = 0; i < parts; i++) {
            int partLength = message.length() / parts + (i == 0 ? message.length() % parts : 0);
            result[i] = message.substring(0, partLength) + "<" + (i + 1) + "/" + parts + ">";
            message = message.substring(partLength);
        }
        return result;
    }
}

