public class Solution {
    public int subarrayLCM(int[] nums, int k) {
        int n = nums.length;
        int res = 0;

        for (int i = 0; i < n; i++) {
            long lcm = nums[i];

            if (lcm == k) {
                res++;
            }

            for (int j = i + 1; j < n; j++) {
                lcm = lcm(nums[j], lcm);

                if (lcm > k || lcm % k != 0) {
                    break;
                } else if (lcm == k) {
                    res++;
                }
            }
        }

        return res;
    }

    private long gcd(long a, long b) {
        return b == 0 ? a : gcd(b, a % b);
    }

    private long lcm(long a, long b) {
        return (a * b) / gcd(a, b);
    }
}

