public class Solution {
    public String robotWithString(String s) {
        StringBuilder sb = new StringBuilder();
        Stack<Character> stack = new Stack<>();

        for (char c : s.toCharArray()) {
            stack.push(c);
        }

        while (!stack.isEmpty()) {
            char top = stack.peek();
            if (sb.length() == 0 || top <= sb.charAt(sb.length() - 1)) {
                sb.append(stack.pop());
            } else {
                break;
            }
        }

        while (!stack.isEmpty()) {
            while (!stack.isEmpty() && stack.peek() > sb.charAt(sb.length() - 1)) {
                sb.append(stack.pop());
            }

            if (stack.isEmpty()) {
                break;
            }

            char c = stack.pop();
            sb.append(c);
        }

        return sb.toString();
    }
}

