public class Solution {
    public long minimumTotalCost(int[] nums1, int[] nums2) {
        Map<Integer, Integer> count = new HashMap<>();
        for (int i = 0; i < nums1.length; i++) {
            if (nums1[i] == nums2[i]) {
                count.put(nums1[i], count.getOrDefault(nums1[i], 0) + 1);
            }
        }

        int maxCount = 0;
        int maxKey = -1;
        for (Map.Entry<Integer, Integer> entry : count.entrySet()) {
            if (entry.getValue() > maxCount) {
                maxCount = entry.getValue();
                maxKey = entry.getKey();
            }
        }

        if (maxCount * 2 <= nums1.length) {
            return calculateCost(nums1, nums2);
        } else {
            int[] newNums1 = new int[nums1.length];
            for (int i = 0; i < nums1.length; i++) {
                if (nums1[i] != maxKey) {
                    newNums1[i] = nums1[i];
                }
            }

            return calculateCost(newNums1, nums2);
        }
    }

    private long calculateCost(int[] nums1, int[] nums2) {
        boolean[] visited = new boolean[nums1.length];
        long cost = 0;
        for (int i = 0; i < nums1.length; i++) {
            if (!visited[i] && nums1[i] == nums2[i]) {
                int j = findNext(nums1, nums2, i + 1);
                if (j != -1) {
                    visited[j] = true;
                    cost += i + j;
                } else {
                    return -1; // not possible
                }
            }
        }
        return cost;
    }

    private int findNext(int[] nums1, int[] nums2, int start) {
        for (int i = start; i < nums1.length; i++) {
            if (nums1[i] != nums2[i]) {
                return i;
            }
        }
        return -1;
    }
}

