public class Solution {
    public int boxDelivering(int[][] boxes, int portsCount, int maxBoxes, int maxWeight) {
        int n = boxes.length;
        int[] prefix = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefix[i + 1] = prefix[i] + boxes[i][1];
        }

        int[][] dp = new int[n + 1][n + 1];
        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = Integer.MAX_VALUE / 2;
            }
        }

        dp[0][0] = 0;
        for (int i = 1; i <= n; i++) {
            int p = boxes[i - 1][0];
            for (int j = 1; j <= Math.min(i, maxBoxes); j++) {
                if (prefix[i] - prefix[i - j] > maxWeight) continue;

                dp[i][j] = Integer.MAX_VALUE / 2;
                for (int k = 0; k < i; k++) {
                    int prevPort = boxes[k][0];
                    if (prevPort == p) {
                        dp[i][j] = Math.min(dp[i][j], dp[k][Math.max(0, j - 1)] + 1);
                    } else {
                        dp[i][j] = Math.min(dp[i][j], dp[k][Math.max(0, j - 1)] + 2);
                    }
                }
            }
        }

        int ans = Integer.MAX_VALUE / 2;
        for (int i = 1; i <= n; i++) {
            if (prefix[n] - prefix[i] > maxWeight) continue;

            ans = Math.min(ans, dp[n][i]);
        }

        return ans + 1;
    }
}

