public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int createSortedArray(int[] instructions) {
        int n = instructions.length;
        long res = 0;

        BinaryIndexedTree less = new BinaryIndexedTree(n);
        BinaryIndexedTree greater = new BinaryIndexedTree(n);

        for (int i = 0; i < n; i++) {
            res += Math.min(less.query(instructions[i] - 1), greater.query(n - instructions[i]));
            res %= MOD;

            less.update(instructions[i], 1);
            greater.update(instructions[i], 1);
        }

        return (int) res;
    }

    private static class BinaryIndexedTree {
        int[] tree;
        int n;

        public BinaryIndexedTree(int n) {
            this.n = n + 5;
            tree = new int[this.n];
        }

        public void update(int i, int val) {
            while (i < n) {
                tree[i] += val;
                i += i & -i;
            }
        }

        public int query(int i) {
            int sum = 0;
            while (i > 0) {
                sum += tree[i];
                i -= i & -i;
            }
            return sum;
        }
    }
}

