import java.util.Comparator;

// #Hard #Array #Dynamic_Programming #Bit_Manipulation #Bitmask
// #2022_04_17_Time_1_ms_(100.00%)_Space_39.8_MB_(97.56%)
public class Solution {
    public int minimumIncompatibility(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        if (n % k != 0) return -1;

        int subsetSize = n / k;
        boolean[][] dp = new boolean[k][1 << subsetSize];
        int[] minDiff = new int[1 << subsetSize];

        for (int i = 0; i < k; i++) {
            Arrays.fill(minDiff, Integer.MAX_VALUE);
            for (int mask = 0; mask < (1 << subsetSize); mask++) {
                if (Integer.bitCount(mask) == 0) {
                    dp[i][mask] = true;
                    minDiff[mask] = 0;
                } else {
                    int maxVal = -1, minVal = Integer.MAX_VALUE;
                    for (int j = 0; j < subsetSize; j++) {
                        if ((mask & (1 << j)) != 0) {
                            maxVal = Math.max(maxVal, nums[i * subsetSize + j]);
                            minVal = Math.min(minVal, nums[i * subsetSize + j]);
                        }
                    }

                    for (int subMask = mask; subMask > 0; subMask = (subMask - 1) & mask) {
                        if (dp[i][mask ^ subMask]) {
                            int diff = maxVal - minVal;
                            minDiff[mask] = Math.min(minDiff[mask], minDiff[mask ^ subMask] + diff);
                        }
                    }

                    dp[i][mask] = minDiff[mask] != Integer.MAX_VALUE;
                }
            }
        }

        return minDiff[(1 << subsetSize) - 1];
    }
}

