public class Solution {
    public boolean isEvenOddTree(TreeNode root) {
        if (root == null) return true;

        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        int level = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();
            List<Integer> values = new ArrayList<>();

            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll();
                values.add(node.val);

                if (node.left != null) queue.offer(node.left);
                if (node.right != null) queue.offer(node.right);
            }

            if ((level % 2 == 0 && !isIncreasing(values)) || 
                (level % 2 == 1 && !isDecreasing(values))) {
                return false;
            }

            level++;
        }

        return true;
    }

    private boolean isIncreasing(List<Integer> values) {
        for (int i = 0; i < values.size() - 1; i++) {
            if (values.get(i) % 2 == 0 || values.get(i + 1) % 2 == 0 || 
                values.get(i) >= values.get(i + 1)) {
                return false;
            }
        }

        return true;
    }

    private boolean isDecreasing(List<Integer> values) {
        for (int i = 0; i < values.size() - 1; i++) {
            if (values.get(i) % 2 != 0 || values.get(i + 1) % 2 != 0 || 
                values.get(i) <= values.get(i + 1)) {
                return false;
            }
        }

        return true;
    }
}

