public class Solution {
    public String kthSmallestPath(int[] destination, int k) {
        int m = destination[0];
        int n = destination[1];

        BigInteger[][] comb = new BigInteger[m + n][m + 1];
        for (int i = 0; i <= m + n; i++) {
            comb[i][0] = BigInteger.ONE;
            comb[i][i] = BigInteger.ONE;
            for (int j = 1; j < i; j++) {
                comb[i][j] = comb[i - 1][j - 1].add(comb[i - 1][j]);
            }
        }

        List<String> res = new ArrayList<>();
        dfs(m, n, "", k, comb, res);
        return res.get(0);
    }

    private void dfs(int m, int n, String path, int k, BigInteger[][] comb, List<String> res) {
        if (m == 0 && n == 0) {
            res.add(path);
            return;
        }
        if (res.size() >= k) return;

        if (m > 0) {
            BigInteger val = comb[m + n - 1][m - 1];
            if (val.compareTo(BigInteger.valueOf(k)) < 0) {
                dfs(m, n - 1, path + "V", k - val.intValue(), comb, res);
            } else {
                dfs(m - 1, n, path + "H", k, comb, res);
            }
        } else {
            dfs(m, n - 1, path + "V", k, comb, res);
        }
    }
}

