public class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        int m = matrix.length, n = matrix[0].length;
        int[][] res = new int[m][n];
        int[] rowMax = new int[m], colMax = new int[n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                rowMax[i] = Math.max(rowMax[i], matrix[i][j]);
                colMax[j] = Math.max(colMax[j], matrix[i][j]);
            }
        }

        int[][] sorted = new int[m * n][3];
        for (int i = 0, k = 0; i < m; i++) {
            for (int j = 0; j < n; j++, k++) {
                sorted[k] = new int[]{matrix[i][j], i, j};
            }
        }

        Arrays.sort(sorted, Comparator.comparingInt(a -> a[0]));

        for (int[] x : sorted) {
            res[x[1]][x[2]] = Math.max(rowMax[x[1]], colMax[x[2]]);
            rowMax[x[1]] = Math.max(rowMax[x[1]], ++res[x[1]][x[2]]);
            colMax[x[2]] = Math.max(colMax[x[2]], res[x[1]][x[2]]);
        }

        return res;
    }
