public class Solution {
    public int[] getSumAbsoluteDifferences(int[] nums) {
        int n = nums.length;
        int[] result = new int[n];

        // Calculate prefix sum of nums array
        long[] prefixSum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }

        for (int i = 0; i < n; i++) {
            // Calculate sum of absolute differences between nums[i] and all elements to its left
            long leftSum = (long) i * nums[i] - prefixSum[i];

            // Calculate sum of absolute differences between nums[i] and all elements to its right
            long rightSum = prefixSum[n] - prefixSum[i + 1] - (long) (n - i - 1) * nums[i];

            result[i] = (int) (leftSum + rightSum);
        }

        return result;
    }
}

