public class Solution {
    public int[] countSubgraphsForEachDiameter(int n, int[][] edges) {
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 0; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }

        int[] res = new int[n - 1];
        for (int i = 1; i <= n; i++) {
            Map<Integer, Integer> map = new HashMap<>();
            dfs(graph, i, map);
            for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
                if ((entry.getKey() & (entry.getKey() - 1)) == 0) {
                    res[entry.getValue() - 1] += 1;
                }
            }
        }

        return res;
    }

    private void dfs(List<Integer>[] graph, int root, Map<Integer, Integer> map) {
        boolean[] visited = new boolean[graph.length];
        dfs(graph, root, visited, 0);

        for (int i = 1; i < graph[root].size(); i++) {
            visited = new boolean[graph.length];
            dfs(graph, root, visited, i);
        }
    }

    private void dfs(List<Integer>[] graph, int node, boolean[] visited, int index) {
        if (visited[node]) return;

        visited[node] = true;
        for (int next : graph[node]) {
            if (next != 1 && !visited[next]) {
                dfs(graph, next, visited, index);
            }
        }

        if (node == 1) {
            int mask = 0;
            for (int i = 2; i < visited.length; i++) {
                if (visited[i]) {
                    mask |= (1 << (i - 2));
                }
            }

            graph[1].get(index).add(mask);
        }
    }

    private void dfs(List<Integer>[] graph, int node, Map<Integer, Integer> map) {
        boolean[] visited = new boolean[graph.length];
        dfs(graph, node, visited, 0, map);

        for (int i = 1; i < graph[node].size(); i++) {
            visited = new boolean[graph.length];
            dfs(graph, node, visited, i, map);
        }
    }

    private void dfs(List<Integer>[] graph, int node, boolean[] visited, int index, Map<Integer, Integer> map) {
        if (visited[node]) return;

        visited[node] = true;
        for (int next : graph[node]) {
            if (!visited[next]) {
                dfs(graph, next, visited, index, map);
            }
        }

        if (node == 1) {
            int mask = 0;
            for (int i = 2; i < visited.length; i++) {
                if (visited[i]) {
                    mask |= (1 << (i - 2));
                }
            }

            graph[1].get(index).add(mask);
        } else {
            int maxDist = getMaxDistance(visited, graph[node]);
            map.put(maxDist, map.getOrDefault(maxDist, 0) + 1);
        }
    }

    private int getMaxDistance(boolean[] visited, List<Integer> nodes) {
        int maxDist = 0;

        for (int node : nodes) {
            if (!visited[node]) continue;

            boolean[] tempVisited = new boolean[visited.length];
            int dist = getDistance(node, tempVisited);
            maxDist = Math.max(maxDist, dist);
        }

        return maxDist;
    }

    private int getDistance(int node, boolean[] visited) {
        if (visited[node]) return 0;

        visited[node] = true;
        int maxDist = 0;

        for (int next : graph[node]) {
            if (!visited[next]) {
                maxDist = Math.max(maxDist, getDistance(next, visited));
            }
        }

        return maxDist + 1;
    }

    private List<Integer>[] graph;

    public static void main(String[] args) {
        Solution solution = new Solution();
        int n = 4;
        int[][] edges = {{1,2},{2,3},{2,4}};
        int[] res = solution.countSubgraphsForEachDiameter(n, edges);

        for (int i : res) {
            System.out.println(i);
        }
    }
}

