        while (!uniqueFreqs.equals(new HashSet<>(freqMap.values()))) {
            Map<Character, Integer> tempMap = new HashMap<>();
            for (char c : freqMap.keySet()) {
                int freq = freqMap.get(c);
                if (uniqueFreqs.contains(freq)) {
                    uniqueFreqs.remove(freq);
                    deletions += 1;
                    tempMap.put(c, freq - 1);
                } else {
                    tempMap.put(c, freq);
                }
            }
            freqMap = tempMap;
        }

        return deletions;
    }
}

