public class Solution {
    public String findLexSmallestString(String s, int a, int b) {
        Set<String> visited = new HashSet<>();
        visited.add(s);
        String res = s;

        while (true) {
            String next = addA(res, a);
            if (!visited.contains(next)) {
                visited.add(next);
                res = next;
            } else {
                break;
            }
        }

        while (true) {
            String next = rotateB(res, b);
            if (!visited.contains(next)) {
                visited.add(next);
                res = next;
            } else {
                break;
            }
        }

        return res;
    }

    private String addA(String s, int a) {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < s.length(); i++) {
            if (i % 2 == 1) {
                int num = (s.charAt(i) - '0' + a) % 10;
                sb.append(num);
            } else {
                sb.append(s.charAt(i));
            }
        }
        return sb.toString();
    }

    private String rotateB(String s, int b) {
        StringBuilder sb = new StringBuilder();
        for (int i = s.length() - b; i < s.length(); i++) {
            sb.append(s.charAt(i));
        }
        for (int i = 0; i < s.length() - b; i++) {
            sb.append(s.charAt(i));
        }
        return sb.toString();
    }
}

