public class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        int same = 0;
        List<Double> angles = new ArrayList<>();

        for (List<Integer> point : points) {
            if (point.get(0).equals(location.get(0)) && point.get(1).equals(location.get(1))) {
                same++;
            } else {
                double a = Math.atan2(point.get(1) - location.get(1), point.get(0) - location.get(0));
                angles.add(a);
            }
        }

        Collections.sort(angles);

        int n = angles.size();
        for (int i = 0; i < n; i++) {
            angles.add(angles.get(i) + 2 * Math.PI);
        }

        double target = angle * Math.PI / 180;
        int max = 0, left = 0;

        for (int right = 0; right < angles.size(); right++) {
            while (angles.get(right) - angles.get(left) > target) {
                left++;
            }
            max = Math.max(max, right - left + 1);
        }

        return same + max;
    }
}

