public class Solution {
    public int[] bestCoordinate(int[][] towers, int radius) {
        int maxX = 0;
        int maxY = 0;

        for (int[] tower : towers) {
            maxX = Math.max(maxX, tower[0]);
            maxY = Math.max(maxY, tower[1]);
        }

        int maxQuality = 0;
        int[] bestCoordinate = new int[]{0, 0};

        for (int x = 0; x <= maxX; x++) {
            for (int y = 0; y <= maxY; y++) {
                int quality = 0;

                for (int[] tower : towers) {
                    double distance = Math.sqrt(Math.pow(x - tower[0], 2) + Math.pow(y - tower[1], 2));

                    if (distance <= radius) {
                        quality += tower[2] / (int)(1 + distance);
                    }
                }

                if (quality > maxQuality) {
                    maxQuality = quality;
                    bestCoordinate[0] = x;
                    bestCoordinate[1] = y;
                } else if (quality == maxQuality && (x < bestCoordinate[0] || (x == bestCoordinate[0] && y < bestCoordinate[1]))) {
                    bestCoordinate[0] = x;
                    bestCoordinate[1] = y;
                }
            }
        }

        return bestCoordinate;
    }
}

