    public int waysToMakeFair(int[] nums) {
        int n = nums.length;
        int oddSum = 0, evenSum = 0;

        // Calculate initial sums of odd and even indexed elements
        for (int i = 0; i < n; i++) {
            if ((i & 1) == 1) {
                oddSum += nums[i];
            } else {
                evenSum += nums[i];
            }
        }

