public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numberOfSets(int n, int k) {
        long[][] dp = new long[n + 1][k + 1];

        for (int i = 0; i <= n; i++) {
            dp[i][0] = 1;
        }

        for (int i = 2; i <= n; i++) {
            int l = Math.max(0, i - k * 2 + 1);
            long sum = 0;

            for (int j = l; j < i; j++) {
                sum += dp[j][Math.min(k, (i - j) / 2)];
                if (j >= 2) {
                    sum -= dp[j - 2][Math.min(k, (i - j + 2) / 2)];
                }

                if (sum < 0) {
                    sum += MOD;
                }
            }

            for (int t = 1; t <= k && i >= t * 2; t++) {
                dp[i][t] = sum % MOD;
            }
        }

        return (int) dp[n][k];
    }
}

