public class Solution {
    public int maximumRequests(int n, int[][] requests) {
        int[] delta = new int[n];
        return backtrack(requests, 0, delta, 0);
    }

    private int backtrack(int[][] requests, int index, int[] delta, int count) {
        if (index == requests.length) {
            for (int d : delta) {
                if (d != 0) {
                    return 0;
                }
            }
            return count;
        }

        int from = requests[index][0];
        int to = requests[index][1];

        // try not to move the employee
        int result = backtrack(requests, index + 1, delta, count);

        // try to move the employee
        delta[from]--;
        delta[to]++;
        result = Math.max(result, backtrack(requests, index + 1, delta, count + 1));

        // restore the state of delta array
        delta[from]++;
        delta[to]--;

        return result;
    }
}

