public class Solution {
    private int[] parent;
    private int[] rank;

    public Dsu(int n) {
        parent = new int[n];
        rank = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
    }

    public int find(int num) {
        if (parent[num] != num) {
            parent[num] = find(parent[num]);
        }
        return parent[num];
    }

    public boolean[] distanceLimitedPathsExist(int n, int[][] edgeList, int[][] queries) {
        Arrays.sort(edgeList, Comparator.comparingInt(a -> a[2]));
        Integer[] queryIndices = new Integer[queries.length];
        for (int i = 0; i < queries.length; i++) {
            queryIndices[i] = i;
        }
        Arrays.sort(queryIndices, (a, b) -> Integer.compare(queries[a][2], queries[b][2]));

        Dsu dsu = new Dsu(n);
        boolean[] result = new boolean[queries.length];
        int edgeIndex = 0;

        for (int queryIndex : queryIndices) {
            while (edgeIndex < edgeList.length && edgeList[edgeIndex][2] < queries[queryIndex][2]) {
                dsu.union(edgeList[edgeIndex][0], edgeList[edgeIndex][1]);
                edgeIndex++;
            }
            result[queryIndex] = dsu.find(queries[queryIndex][0]) == dsu.find(queries[queryIndex][1]);
        }

        return result;
    }

    public void union(int x, int y) {
        int rootX = find(x);
        int rootY = find(y);

        if (rootX != rootY) {
            if (rank[rootX] > rank[rootY]) {
                parent[rootY] = rootX;
            } else if (rank[rootX] < rank[rootY]) {
                parent[rootX] = rootY;
            } else {
                parent[rootY] = rootX;
                rank[rootX]++;
            }
        }
    }

    public class Solution {
        private Solution solution;

        public Dsu(int n) {
            solution = new Solution();
            solution.new Dsu(n);
        }

        public int find(int num) {
            return solution.find(num);
        }

        public void union(int x, int y) {
            solution.union(x, y);
        }
    }
}

