import java.util.LinkedList;
import java.util.List;
import java.util.PriorityQueue;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);

        for (int i = 0; i < forest.size(); i++) {
            for (int j = 0; j < forest.get(0).size(); j++) {
                if (forest.get(i).get(j) > 1) {
                    pq.offer(new int[] {i, j, forest.get(i).get(j)});
                }
            }
        }

        int res = 0;
        int[] start = new int[2];

        while (!pq.isEmpty()) {
            int[] tree = pq.poll();
            int step = bfs(forest, start, tree);
            if (step == -1) return -1;
            res += step;
            start[0] = tree[0];
            start[1] = tree[1];
        }

        return res;
    }

    private int bfs(List<List<Integer>> forest, int[] start, int[] end) {
        if (start[0] == end[0] && start[1] == end[1]) return 0;

        boolean[][] visited = new boolean[forest.size()][forest.get(0).size()];
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(start);
        visited[start[0]][start[1]] = true;

        int step = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] cur = queue.poll();
                if (cur[0] == end[0] && cur[1] == end[1]) return step;

                int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
                for (int[] dir : dirs) {
                    int x = cur[0] + dir[0];
                    int y = cur[1] + dir[1];

                    if (x >= 0 && x < forest.size() && y >= 0 && y < forest.get(0).size()
                        && !visited[x][y] && forest.get(x).get(y) != 0) {
                        queue.offer(new int[] {x, y});
                        visited[x][y] = true;
                    }
                }
            }

            step++;
        }

        return -1;
    }
}

