import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode trimBST(TreeNode root, int low, int high) {
        if (root == null) return null;

        // If the current node's value is less than low, 
        // we only need to consider its right subtree
        if (root.val < low) {
            return trimBST(root.right, low, high);
        }

        // If the current node's value is greater than high, 
        // we only need to consider its left subtree
        if (root.val > high) {
            return trimBST(root.left, low, high);
        }

        // Otherwise, we recursively trim both subtrees
        root.left = trimBST(root.left, low, high);
        root.right = trimBST(root.right, low, high);

        return root;
    }
}

