public class Solution {
    public int findKthNumber(int m, int n, int k) {
        int left = 1;
        int right = m * n + 1;

        while (left < right) {
            int mid = left + (right - left) / 2;
            if (!enough(mid, m, n, k)) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }

        return left;
    }

    private boolean enough(int x, int m, int n, int k) {
        int count = 0;
        for (int i = 1; i <= m; i++) {
            count += Math.min(x / i, n);
        }
        return count >= k;
    }
}

