public class Solution {
    public boolean judgePoint24(int[] cards) {
        return dfs(cards, 0);
    }

    private boolean dfs(int[] cards, int index) {
        if (index == 3) {
            return Math.abs(cards[3] - 24) < 1e-6;
        }
        for (int i = index; i < cards.length; i++) {
            for (int j = i + 1; j < cards.length; j++) {
                double[] temp = new double[]{cards[i], cards[j]};
                int[] nextCards = Arrays.copyOf(cards, cards.length);
                nextCards[index] = -1;
                nextCards[i] = -1;
                nextCards[j] = -1;
                for (int k = 0; k < nextCards.length; k++) {
                    if (nextCards[k] != -1) {
                        double[] newTemp = new double[]{temp[0], temp[1]};
                        newTemp[index % 2] = nextCards[k];
                        nextCards[k] = -1;
                        for (int l = index + 1; l < cards.length; l++) {
                            if (nextCards[l] != -1) {
                                nextCards[l] = -1;
                                break;
                            }
                        }
                        double[] result = new double[]{newTemp[0], newTemp[1]};
                        for (int op = 0; op < 4; op++) {
                            switch (op) {
                                case 0:
                                    result[1] = temp[0] + temp[1];
                                    break;
                                case 1:
                                    result[1] = temp[0] - temp[1];
                                    break;
                                case 2:
                                    result[1] = temp[0] * temp[1];
                                    break;
                                default:
                                    if (temp[1] == 0) continue;
                                    result[1] = temp[0] / temp[1];
                            }
                            nextCards[index + 1] = (int) result[1];
                            if (dfs(nextCards, index + 1)) return true;
                        }
                    }
                }
            }
        }
