public class Solution {
    public int strangePrinter(String s) {
        int n = s.length();
        int[][] dp = new int[n + 1][n + 1];

        for (int i = n - 1; i >= 0; --i) {
            for (int j = i; j < n; ++j) {
                if (s.charAt(i) == s.charAt(j)) {
                    dp[i][j] = dp[i + 1][j];
                } else {
                    int min = Integer.MAX_VALUE;
                    for (int k = i + 1; k <= j; ++k) {
                        if (s.charAt(k) == s.charAt(i)) {
                            min = Math.min(min, dp[i + 1][k - 1] + dp[k][j]);
                        }
                    }
                    dp[i][j] = min;
                }
            }
        }

        return dp[0][n - 1] + 1;
    }
}

