public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int kInversePairs(int n, int k) {
        int[][] dp = new int[n + 1][k + 1];

        for (int i = 0; i <= n; i++) {
            dp[i][0] = 1;
        }

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                int l = Math.max(0, j - i + 1);
                for (int p = l; p <= j; p++) {
                    dp[i][j] += dp[i - 1][p];
                    if (dp[i][j] >= MOD) {
                        dp[i][j] -= MOD;
                    }
                }
            }
        }

        return dp[n][k];
    }
}

