public class Solution {
    public int flipLights(int n, int m) {
        if (n == 0 || m == 0) return 1;
        if (n == 1) return Math.min(m + 1, 2);
        if (m == 1) return Math.min(n, 3);
        if (m >= 3) return Math.min(8, n < 3 ? 4 : 8);
        int res = 0;
        for (int i = 0; i < 16; i++) {
            String s = Integer.toBinaryString(i).substring(Integer.toBinaryString(i).length() - 4);
            while (s.length() < 4) s = "0" + s;
            int cnt = 0, tmp = 0;
            for (int j = 1; j <= n; j++) {
                boolean b = false;
                if ((j & 1) == 1 && s.charAt(2) == '1') b ^= true;
                if ((j % 2) == 0 && s.charAt(3) == '1') b ^= true;
                if (j % 3 == 1 && s.charAt(1) == '1') b ^= true;
                if (s.charAt(0) == '1') b ^= true;
                tmp += b ? 1 : 0;
            }
            cnt = Math.abs(n - 2 * tmp);
            res += cnt <= m ? 1 : 0;
        }
        return res / 16 + (res % 16 != 0 ? 1 : 0);
    }
}

