// #2022_03_22_Time_1_ms_(96.65%)_Space_44.6_MB_(25.00%)
public class Solution {
    public int[] findRedundantDirectedConnection(int[][] edges) {
        int n = edges.length;
        UnionFind uf = new UnionFind(n + 1);
        int[] parent = new int[n + 1];
        Arrays.fill(parent, -1);

        for (int[] edge : edges) {
            if (parent[edge[1]] != -1) {
                return new int[]{parent[edge[1]], edge[1], edge[0], edge[1]};
            }
            parent[edge[1]] = edge[0];
        }

        Arrays.fill(parent, -1);
        for (int[] edge : edges) {
            if (edge[0] == parent[edge[1]]) continue;
            if (!uf.union(edge[0], edge[1])) return edge;
            parent[edge[1]] = edge[0];
        }
        return new int[]{};
    }

    class UnionFind {
        private int[] root;

        public UnionFind(int n) {
            this.root = new int[n];
            for (int i = 0; i < n; i++) {
                root[i] = i;
            }
        }

        public int find(int x) {
            if (x == root[x]) return x;
            return root[x] = find(root[x]);
        }

        public boolean union(int x, int y) {
            int rootX = find(x);
            int rootY = find(y);
            if (rootX != rootY) {
                root[rootY] = rootX;
                return true;
            }
            return false;
        }
    }
}

