public class Solution {
    public int shoppingOffers(List<Integer> price, List<List<Integer>> special, List<Integer> needs) {
        Map<String, Integer> memo = new HashMap<>();
        return dfs(price, special, needs, memo);
    }

    private int dfs(List<Integer> price, List<List<Integer>> special, List<Integer> needs, Map<String, Integer> memo) {
        String key = toString(needs);
        if (memo.containsKey(key)) {
            return memo.get(key);
        }

        int res = 0;
        for (int i = 0; i < needs.size(); i++) {
            res += price.get(i) * needs.get(i);
        }

        for (List<Integer> s : special) {
            List<Integer> cloneNeeds = new ArrayList<>(needs);
            boolean valid = true;
            for (int i = 0; i < needs.size(); i++) {
                int need = cloneNeeds.get(i) - s.get(i);
                if (need < 0) {
                    valid = false;
                    break;
                }
                cloneNeeds.set(i, need);
            }

            if (valid) {
                res = Math.min(res, s.get(needs.size()) + dfs(price, special, cloneNeeds, memo));
            }
        }

        memo.put(key, res);
        return res;
    }

    private String toString(List<Integer> needs) {
        StringBuilder sb = new StringBuilder();
        for (int need : needs) {
            sb.append(need).append(",");
        }
        return sb.toString();
    }
