public class Solution {
    public int maximumSwap(int num) {
        char[] digits = String.valueOf(num).toCharArray();
        int n = digits.length;

        // find the first digit that is smaller than the max digit on its right side
        int[] lastDigitIndex = new int[10];
        for (int i = 0; i < n; i++) {
            int digit = digits[i] - '0';
            for (int j = 9; j > digit; j--) {
                if (lastDigitIndex[j] != 0) {
                    // swap the current digit with the max digit on its right side
                    char temp = digits[i];
                    digits[i] = digits[lastDigitIndex[j]];
                    digits[lastDigitIndex[j]] = temp;
                    return Integer.parseInt(new String(digits));
                }
            }
            lastDigitIndex[digit] = i;
        }

        // if no such digit is found, the number is already the maximum
        return num;
    }
}

