import java.util.Arrays;

public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        int sum = 0;
        for (int num : nums) {
            sum += num;
        }

        if (sum % k != 0) return false;

        int target = sum / k;
        Arrays.sort(nums);
        reverseArray(nums);

        boolean[] visited = new boolean[nums.length];
        return dfs(nums, visited, 0, k, target, 0);
    }

    private void reverseArray(int[] nums) {
        int left = 0, right = nums.length - 1;
        while (left < right) {
            swap(nums, left++, right--);
        }
    }

    private void swap(int[] nums, int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }

    private boolean dfs(int[] nums, boolean[] visited, int index, int k, int target, int sum) {
        if (k == 1) return true;

        if (sum == target) {
            return dfs(nums, visited, 0, k - 1, target, 0);
        }

        for (int i = index; i < nums.length; i++) {
            if (!visited[i] && sum + nums[i] <= target) {
                visited[i] = true;
                if (dfs(nums, visited, i + 1, k, target, sum + nums[i])) return true;
                visited[i] = false;
            }
        }

        return false;
    }
}

