        if(node == null) {
            return 0;
        } else {
            return Math.max(getHeight(node.left), getHeight(node.right)) + 1;
        }
    }

    private void dfs(TreeNode node, List<List<String>> res, int row, int col, int height) {
        if(node == null) {
            return;
        }

        res.get(row).set(col, String.valueOf(node.val));

        dfs(node.left, res, row + 1, col - (int)Math.pow(2, height - row - 1), height);
        dfs(node.right, res, row + 1, col + (int)Math.pow(2, height - row - 1), height);
    }
}

