public class Solution {
    public int calculateMinimumHP(int[][] dungeon) {
        int m = dungeon.length;
        int n = dungeon[0].length;

        // Initialize dp array with Integer.MAX_VALUE
        int[][] dp = new int[m + 1][n + 1];
        for (int i = 0; i <= m; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = Integer.MAX_VALUE;
            }
        }

        // Set the base case
        dp[m][n - 1] = dp[m - 1][n] = 1;

        // Fill up the dp array in a bottom-up manner
        for (int i = m - 1; i >= 0; i--) {
            for (int j = n - 1; j >= 0; j--) {
                int minHealth = Math.min(dp[i + 1][j], dp[i][j + 1]) - dungeon[i][j];
                dp[i][j] = Math.max(minHealth, 1);
            }
        }

        // The minimum initial health is stored in dp[0][0]
        return dp[0][0];
    }
}

