import java.util.Arrays;
public class Solution {
    public int maximumGap(int[] nums) {
        if (nums.length < 2) return 0;

        int min = Arrays.stream(nums).min().getAsInt();
        int max = Arrays.stream(nums).max().getAsInt();

        if (min == max) return 0;

        double bucketSize = Math.max(1, (double)(max - min) / (nums.length - 1));
        int bucketCount = (int)Math.ceil((double)(max - min) / bucketSize);

        Bucket[] buckets = new Bucket[bucketCount];
        for (int i = 0; i < bucketCount; i++) {
            buckets[i] = new Bucket();
        }

        for (int num : nums) {
            int index = (int)((num - min) / bucketSize);
            if (index == bucketCount) index--;
            buckets[index].update(num);
        }

        int maxGap = 0;
        int prevMax = buckets[0].max;
        for (int i = 1; i < bucketCount; i++) {
            if (buckets[i].min != Integer.MIN_VALUE) {
                maxGap = Math.max(maxGap, buckets[i].min - prevMax);
                prevMax = buckets[i].max;
            }
        }

        return maxGap;
    }

    private static class Bucket {
        int min = Integer.MAX_VALUE;
        int max = Integer.MIN_VALUE;

        void update(int num) {
            if (num < min) min = num;
            if (num > max) max = num;
        }
    }
}

