public class Solution {
    public int maxPoints(int[][] points) {
        if (points.length <= 2) return points.length;

        int n = points.length, res = 0;
        for (int i = 0; i < n; ++i) {
            Map<Double, Integer> map = new HashMap<>();
            int samePoint = 1, localMax = 0;
            for (int j = i + 1; j < n; ++j) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    samePoint++;
                    continue;
                }

                double slope = getSlope(points, i, j);
                map.put(slope, map.getOrDefault(slope, 0) + 1);
                localMax = Math.max(localMax, map.get(slope));
            }
            res = Math.max(res, localMax + samePoint);
        }

        return res;
    }

    private double getSlope(int[][] points, int i, int j) {
        int xDiff = points[j][0] - points[i][0];
        int yDiff = points[j][1] - points[i][1];

        if (xDiff == 0) return Double.POSITIVE_INFINITY;
        if (yDiff == 0) return 0.0;

        double slope = (double)yDiff / xDiff;
        return slope;
    }
}

