    public void solve(char[][] board) {
        // Edge case, empty grid
        if (board == null || board.length == 0) return;

        int m = board.length;
        int n = board[0].length;

        // Traverse first and last rows ( boundaries)
        for (int i = 0; i < m; i++) {
            dfs(board, i, 0);
            dfs(board, i, n - 1);
