    private TreeNode helper(int[] preorder, int preStart, int preEnd, int[] inorder, int inStart, int inEnd, Map<Integer, Integer> inMap) {
        if (preStart > preEnd || inStart > inEnd) return null;

        TreeNode root = new TreeNode(preorder[preStart]);
        int index = inMap.get(root.val);

        root.left = helper(preorder, preStart + 1, preStart + index - inStart, inorder, inStart, index - 1, inMap);
        root.right = helper(preorder, preStart + index - inStart + 1, preEnd, inorder, index + 1, inEnd, inMap);

        return root;
    }
