import java.util.Arrays;
public class Solution {
    public int minCut(String s) {
        int n = s.length();
        boolean[][] isPalindrome = new boolean[n][n];
        int[] cut = new int[n];

        for (int i = 0; i < n; i++) {
            isPalindrome[i][i] = true;
            cut[i] = i;
        }

        for (int i = n - 1; i >= 0; i--) {
            for (int j = i + 1; j < n; j++) {
                if (s.charAt(i) == s.charAt(j)) {
                    isPalindrome[i][j] = (j - i > 2) ? isPalindrome[i + 1][j - 1] : true;
                } else {
                    isPalindrome[i][j] = false;
                }
            }
        }

        for (int i = 1; i < n; i++) {
            if (isPalindrome[0][i]) continue;

            cut[i] = i;
            for (int j = 0; j < i; j++) {
                if (isPalindrome[j + 1][i] && cut[j] + 1 < cut[i]) {
                    cut[i] = cut[j] + 1;
                }
            }
        }

        return cut[n - 1];
    }
}

