import java.util.ArrayList;
import java.util.Collections;
import java.util.HashMap;
import java.util.HashSet;
import java.util.LinkedHashSet;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) return Collections.emptyList();

        Map<String, List<String>> reverseGraph = new HashMap<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(beginWord);

        boolean findEndWord = false;
        while (!queue.isEmpty()) {
            int size = queue.size();
            Set<String> nextLayerNodes = new HashSet<>();

            for (int i = 0; i < size; i++) {
                String currentWord = queue.poll();

                if (currentWord.equals(endWord)) {
                    findEndWord = true;
                }

                char[] chars = currentWord.toCharArray();
                for (int j = 0; j < chars.length; j++) {
                    char originalChar = chars[j];
                    for (char c = 'a'; c <= 'z'; c++) {
                        if (c == originalChar) continue;

                        chars[j] = c;
                        String nextWord = new String(chars);

                        if (!wordSet.contains(nextWord)) continue;

                        reverseGraph.computeIfAbsent(nextWord, k -> new ArrayList<>()).add(currentWord);
                        nextLayerNodes.add(nextWord);
                    }
                    chars[j] = originalChar;
                }
            }

            if (findEndWord) break;

            queue.addAll(nextLayerNodes);
            wordSet.removeAll(nextLayerNodes);
        }

        List<List<String>> ans = new ArrayList<>();
        if (!findEndWord) return ans;

        dfs(ans, reverseGraph, endWord, beginWord, new LinkedList<>());
        return ans;
    }

    private void dfs(List<List<String>> ans, Map<String, List<String>> reverseGraph, String currentWord, String targetWord, List<String> path) {
        path.add(currentWord);

        if (currentWord.equals(targetWord)) {
            Collections.reverse(path);
            ans.add(new ArrayList<>(path));
            Collections.reverse(path);
            return;
        }

        for (String nextWord : reverseGraph.getOrDefault(currentWord, Collections.emptyList())) {
            dfs(ans, reverseGraph, nextWord, targetWord, path);
        }
        path.remove(path.size() - 1);
    }
}

