public class Solution {
    public int makeArrayIncreasing(int[] arr1, int[] arr2) {
        Arrays.sort(arr2);
        TreeSet<Integer> set = new TreeSet<>();
        for (int num : arr2) {
            set.add(num);
        }

        Integer[][] dp = new Integer[arr1.length + 1][arr1.length + 1];
        return dfs(0, -1, arr1, set, dp);
    }

    private int dfs(int i, int prev, int[] arr1, TreeSet<Integer> set, Integer[][] dp) {
        if (i == arr1.length) {
            return 0;
        }

        if (dp[i][prev + 1] != null) {
            return dp[i][prev + 1];
        }

        int res = Integer.MAX_VALUE;
        // keep the current number
        if (prev == -1 || arr1[i] > prev) {
            res = dfs(i + 1, arr1[i], arr1, set, dp);
        } else {
            res = dfs(i + 1, prev, arr1, set, dp) + 1;
        }

        // replace the current number
        Integer next = set.higher(prev);
        if (next != null && next < arr1[i]) {
            res = Math.min(res, dfs(i + 1, next, arr1, set, dp) + 1);
        }

        return dp[i][prev + 1] = res;
    }
}

