            }
        }

        // make odd-indexed elements greater than adjacent ones
        for (int i = 0; i < n; i++) {
            if ((i % 2 != 0 && (i > 0 && nums[i] >= nums[i - 1] || i + 1 < n && nums[i] >= nums[i + 1])) 
