import java.util.Deque;

public class Solution {
    public int mctFromLeafValues(int[] arr) {
        Deque<Integer> stack = new ArrayDeque<>();
        stack.push(Integer.MAX_VALUE);
        int res = 0;

        for (int a : arr) {
            while (stack.peek() <= a) {
                int mid = stack.pop();
                res += Math.min(stack.peek(), a) * mid;
            }
            stack.push(a);
        }

        while (stack.size() > 2) {
            res += stack.pollFirst() * stack.peek();
        }

        return res;
    }
