import java.util.Arrays;
public class Solution {
    public int stoneGameII(int[] piles) {
        int n = piles.length;
        int suffixSum[] = new int[n + 1];
        for (int i = n - 1; i >= 0; --i)
            suffixSum[i] = suffixSum[i + 1] + piles[i];

        Integer[][] memo = new Integer[n][n];
        return dfs(0, 1, suffixSum, memo);
    }

    private int dfs(int i, int m, int[] suffixSum, Integer[][] memo) {
        if (i + 2 * m >= suffixSum.length)
            return suffixSum[i];

        if (memo[i][m] != null)
            return memo[i][m];

        int res = Integer.MIN_VALUE;
        for (int x = 1; x <= 2 * m; ++x) {
            res = Math.max(res, suffixSum[i] - dfs(i + x, Math.max(m, x), suffixSum, memo));
        }
        return memo[i][m] = res;
    }
}

