    public int[] smallestSufficientTeam(String[] req_skills, List<List<String>> people) {
        Map<String, Integer> skillToId = new HashMap<>();
        for (int i = 0; i < req_skills.length; i++) {
            skillToId.put(req_skills[i], i);
        }

        int n = req_skills.length;
        int[] dp = new int[1 << n];
        Arrays.fill(dp, -1);

        List<Integer>[] personSkills = new List[people.size()];
        for (int i = 0; i < people.size(); i++) {
            int skillMask = 0;
            for (String skill : people.get(i)) {
                if (skillToId.containsKey(skill)) {
                    skillMask |= 1 << skillToId.get(skill);
                }
            }
            personSkills[i] = new ArrayList<>();
            personSkills[i].add(skillMask);
            personSkills[i].add(i);
        }

        dp[0] = 0;
        for (int mask = 0; mask < (1 << n); mask++) {
            if (dp[mask] == -1) continue;
            for (List<Integer> ps : personSkills) {
                int newMask = mask | ps.get(0);
                if (newMask > mask && dp[newMask] == -1) {
                    dp[newMask] = ps.get(1);
                }
            }
        }

        List<Integer> res = new ArrayList<>();
        int mask = (1 << n) - 1;
        while (mask != 0) {
            res.add(dp[mask]);
            mask ^= (1 << skillToId.get(req_skills[dp[mask]]));
        }

        int[] result = new int[res.size()];
        for (int i = 0; i < res.size(); i++) {
            result[i] = res.get(i);
        }
