import java.util.Arrays;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numRollsToTarget(int n, int k, int target) {
        int[][] dp = new int[n + 1][target + 1];

        for (int i = 0; i <= n; i++) {
            Arrays.fill(dp[i], -1);
        }

        return helper(n, k, target, dp);
    }

    private int helper(int diceLeft, int faces, int target, int[][] dp) {
        if (target < diceLeft || target > diceLeft * faces) {
            return 0;
        }

        if (diceLeft == 0) {
            return target == 0 ? 1 : 0;
        }

        if (dp[diceLeft][target] != -1) {
            return dp[diceLeft][target];
        }

        int ways = 0;

        for (int face = 1; face <= faces; face++) {
            ways += helper(diceLeft - 1, faces, target - face, dp);
            ways %= MOD;
        }

        dp[diceLeft][target] = ways;

        return ways;
    }
}

