        int count = 0;
        for (int i = 2; i <= n; ++i) {
            if (!notPrimes[i]) {
                count++;
                for (int j = i * 2; j <= n; j += i)
                    notPrimes[j] = true;
            }
        }

        long res = 1;
        for (long l = 1, r = count; l <= r; ++l, --r) {
            res = res * l % 1000000007;
            if (l < r)
                res = res * r % 1000000007;
        }
        for (int i = 1; i <= n - count; ++i)
            res = res * i % 1000000007;

        return (int)res;
    }
}

