public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int kConcatenationMaxSum(int[] arr, int k) {
        if (k == 1) return Kadane(arr);

        long sum = 0;
        for (int num : arr) sum += num;

        if (sum <= 0) {
            long max = Kadane(arr);
            max = Math.max(max, Kadane(concatenateArray(arr, 2)));
            return (int) (max % MOD);
        } else {
            int kadaneOfTwo = Kadane(concatenateArray(arr, 2));
            return (int) ((kadaneOfTwo + sum * (k - 2)) % MOD);
        }
    }

    private int[] concatenateArray(int[] arr, int times) {
        int n = arr.length;
        int[] result = new int[n * times];
        for (int i = 0; i < times; i++) {
            System.arraycopy(arr, 0, result, i * n, n);
        }
        return result;
    }

    private int Kadane(int[] nums) {
        int maxSum = Integer.MIN_VALUE;
        int currentSum = 0;

        for (int num : nums) {
            currentSum = Math.max(num, currentSum + num);
            maxSum = Math.max(maxSum, currentSum);
        }

        return maxSum < 0 ? 0 : maxSum;
    }
}

