public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        int level = 1, nodes = 1, totalNodes = 1;
        while (totalNodes < label) {
            level++;
            nodes *= 2;
            totalNodes += nodes;
        }

        List<Integer> result = new LinkedList<>();
        while (level > 0) {
            if ((level & 1) == 1) {
                result.add(0, label);
            } else {
                int complement = totalNodes - label + 1;
                result.add(0, totalNodes - complement + 1);
            }

            label /= 2;
            nodes /= 2;
            totalNodes -= nodes;
            level--;
        }

        return result;
    }
}

