// #2023_06_01_Time_4_ms_(96.63%)_Space_44.3_MB_(10.59%)
public class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<Integer>[] graph = new ArrayList[2 * n];
        for (int i = 0; i < 2 * n; i++) {
            graph[i] = new ArrayList<>();
        }

        // Build the graph
        for (int[] edge : redEdges) {
            graph[edge[0]].add(edge[1] + n);
            graph[edge[1] + n].add(edge[0]);
        }
        for (int[] edge : blueEdges) {
            graph[edge[0] + n].add(edge[1]);
            graph[edge[1]].add(edge[0] + n);
        }

        int[][] dist = new int[n][2];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dist[i], -1);
        }

        // BFS
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[] {0, 0});
        queue.offer(new int[] {n, 1});
        dist[0][0] = 0;
        dist[0][1] = 0;

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int node = curr[0];
            int color = curr[1];

            for (int neighbor : graph[node]) {
                if ((neighbor < n) == (color == 0)) continue;
                if (dist[neighbor % n][1 - color] != -1) continue;

                dist[neighbor % n][1 - color] = dist[node % n][color] + 1;
                queue.offer(new int[] {neighbor, 1 - color});
            }
        }

        // Build the result
        int[] res = new int[n];
        for (int i = 0; i < n; i++) {
            if (dist[i][0] == -1 && dist[i][1] == -1) {
                res[i] = -1;
            } else if (dist[i][0] == -1 || dist[i][1] == -1) {
                res[i] = Math.max(dist[i][0], dist[i][1]);
            } else {
                res[i] = Math.min(dist[i][0], dist[i][1]);
            }
        }

        return res;
    }
}

