public class Solution {
    public ListNode removeZeroSumSublists(ListNode head) {
        Map<Integer, ListNode> seen = new HashMap<>();
        ListNode dummyHead = new ListNode(0);
        dummyHead.next = head;
        int prefixSum = 0;

        while (dummyHead != null) {
            prefixSum += dummyHead.val;
            if (!seen.containsKey(prefixSum)) {
                seen.put(prefixSum, dummyHead);
            } else {
                ListNode node = seen.get(prefixSum);
                int tmpPrefixSum = prefixSum + dummyHead.next.val;
                while (tmpPrefixSum != prefixSum) {
                    seen.remove(tmpPrefixSum);
                    dummyHead = dummyHead.next;
                    tmpPrefixSum += dummyHead.val;
                }
                node.next = dummyHead.next;
            }
            dummyHead = dummyHead.next;
        }

