public class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int n = words.length;
        int[] freqs = new int[n];

        for (int i = 0; i < n; i++) {
            freqs[i] = f(words[i]);
        }

        Arrays.sort(freqs);

        int m = queries.length;
        int[] res = new int[m];

        for (int i = 0; i < m; i++) {
            int qf = f(queries[i]);
            int idx = binarySearch(freqs, qf + 1);
            res[i] = n - idx;
        }

        return res;
    }

    private int f(String s) {
        char[] chars = s.toCharArray();
        Arrays.sort(chars);
        char minChar = chars[0];
        int count = 0;
        for (char c : chars) {
            if (c == minChar) {
                count++;
            } else {
                break;
            }
        }
        return count;
    }

    private int binarySearch(int[] arr, int target) {
        int left = 0, right = arr.length - 1;
        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (arr[mid] < target) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return left;
    }
}

