import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class Solution {
    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        // build graph
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (List<Integer> connection : connections) {
            int a = connection.get(0);
            int b = connection.get(1);
            graph[a].add(b);
            graph[b].add(a);
        }

        // record rank
        int[] rank = new int[n];
        Arrays.fill(rank, -1);

        List<List<Integer>> result = new ArrayList<>();
        dfs(graph, 0, -1, rank, result, connections);
        return result;
    }

    private void dfs(List<Integer>[] graph, int node, int parent, int[] rank, List<List<Integer>> result, List<List<Integer>> connections) {
        if (rank[node] != -1) {
            return;
        }
        rank[node] = node;

        for (int nei : graph[node]) {
            if (nei == parent) {
                continue;
            }

            dfs(graph, nei, node, rank, result, connections);

            // step1 : run dfs to get the rank of this nei
            if (rank[nei] > rank[node]) {
                // if neiTime is strictly larger than current node's rank, there is no cycle,
                // connections between node and nei is a critically connection.
                for (List<Integer> connection : connections) {
                    int a = connection.get(0);
                    int b = connection.get(1);
                    if ((a == node && b == nei) || (b == node && a == nei)) {
                        result.add(connection);
                    }
                }
            }

            // keep updating current node's rank with nei's smaller ranks
            rank[node] = Math.min(rank[node], rank[nei]);
        }
    }
}

