// #Hard #Array #Divide_and_Conquer #2022_05_21_Time_70_ms_(64.91%)_Space_83.3_MB_(70.18%)
public class Solution {
    public int[] recoverArray(int n, int[] sums) {
        Arrays.sort(sums);
        int[] ans = new int[n];
        for (int i = 0; i < n; ++i) {
            int[] cnt = new int[10001];
            for (int sum : sums)
                if (sum != 0)
                    cnt[sum]++;

            int maxSum = Arrays.stream(sums).max().getAsInt();
            ans[i] = maxSum - (1 << i);
            for (int j = 0; j < (1 << i); ++j) {
                int sum = ans[i] + j;
                if (cnt[sum] > 0)
                    cnt[sum]--;
                else
                    cnt[maxSum - sum]++;
            }

            sums = Arrays.stream(sums).filter(sum -> cnt[sum] > 0).toArray();
        }
        return ans;
    }
}

