public class Solution {
    public long maxMatrixSum(int[][] matrix) {
        int n = matrix.length;
        long sum = 0, min = Integer.MAX_VALUE, countNegatives = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
