import java.util.Arrays;

public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        int n = students.length;
        boolean[] usedMentors = new boolean[n];
        return dfs(students, mentors, 0, usedMentors);
    }

    private int dfs(int[][] students, int[][] mentors, int studentIndex, boolean[] usedMentors) {
        if (studentIndex == students.length) {
            return 0;
        }

        int maxScore = 0;
        for (int i = 0; i < mentors.length; i++) {
            if (!usedMentors[i]) {
                usedMentors[i] = true;
                int score = getCompatibilityScore(students[studentIndex], mentors[i]);
                score += dfs(students, mentors, studentIndex + 1, usedMentors);
                maxScore = Math.max(maxScore, score);
                usedMentors[i] = false;
            }
        }

        return maxScore;
    }

    private int getCompatibilityScore(int[] studentAnswers, int[] mentorAnswers) {
        int score = 0;
        for (int i = 0; i < studentAnswers.length; i++) {
            if (studentAnswers[i] == mentorAnswers[i]) {
                score++;
            }
        }

        return score;
    }
}

