public class Solution {
    public int[] longestObstacleCourseAtEachPosition(int[] obstacles) {
        TreeMap<Integer, Integer> map = new TreeMap<>();
        int[] ans = new int[obstacles.length];

        for (int i = 0; i < obstacles.length; i++) {
            int prevHeight = map.lowerKey(obstacles[i]);
            if (prevHeight == null) {
                prevHeight = -1;
            }

            int prevLength = map.getOrDefault(prevHeight, 0);
            ans[i] = prevLength + 1;
            map.put(obstacles[i], Math.max(map.getOrDefault(obstacles[i], 0), ans[i]));
        }

        return ans;
    }
}

