public class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length, n = mat[0].length;
        int low = 0, high = n - 1;

        while (low <= high) {
            int midCol = low + (high - low) / 2;

            int maxRow = findMaxInColumn(mat, midCol);

            if ((midCol == 0 || mat[maxRow][midCol] > mat[maxRow][midCol - 1]) 
                && (midCol == n - 1 || mat[maxRow][midCol] > mat[maxRow][midCol + 1])) {
                return new int[] {maxRow, midCol};
            } else if (midCol > 0 && mat[maxRow][midCol] < mat[maxRow][midCol - 1]) {
                high = midCol - 1;
            } else {
                low = midCol + 1;
            }
        }

        return new int[] {-1, -1}; // Return a default value if no peak is found
    }

    private int findMaxInColumn(int[][] mat, int col) {
        int maxRow = 0;
        for (int i = 1; i < mat.length; i++) {
            if (mat[i][col] > mat[maxRow][col]) {
                maxRow = i;
            }
        }
        return maxRow;
    }
}

